import requests
import xml.etree.ElementTree as ET

def retrieve_and_parse_diaspora_webfinger(handle):
    """Retrieve a and parse a remote Diaspora webfinger document.

    :arg handle: Remote handle to retrieve
    :returns: dict
    """
    url = f"https://{handle.split('@')[1]}/.well-known/webfinger?resource=acct:{handle}"
    try:
        response = requests.get(url, timeout=10)
        response.raise_for_status()  # Raise HTTPError for bad responses (4xx or 5xx)
        xml_data = response.content

        webfinger_data = {}

        try:
            root = ET.fromstring(xml_data)
        except ET.ParseError as e:
            print(f"Error parsing XML: {e}")
            return None


        for link in root.findall("{http://docs.oasis-open.org/ns/xri/xrd-1.0}Link"):
            rel = link.get("rel")
            if rel == "http://webfinger.net/rel/profile-page":
                webfinger_data["profile_page"] = link.get("href")
            elif rel == "http://schemas.google.com/g/2010#updates-from":
                webfinger_data["updates_from"] = link.get("href")

        # Alias is a direct child, no need to iterate all
        alias_element = root.find("{http://docs.oasis-open.org/ns/xri/xrd-1.0}Alias")
        if alias_element is not None:
            webfinger_data["alias"] = alias_element.text

        return webfinger_data
    except requests.exceptions.RequestException as e:
        print(f"Error retrieving webfinger: {e}")
        return None

