            return result

        def cache_parameters():
            return {"maxsize": maxsize, "ttl": ttl, "timer": timer, "typed": typed}

        def cache_info():
            return {
                "hits": hits,
                "misses": misses,
                "maxsize": maxsize,
                "currsize": len(cache)
            }

        wrapper.cache_parameters = cache_parameters
        wrapper.cache_info = cache_info

