    graph: "Graph", prop: "URIRef", roots: Optional[Set["Node"]] = None
) -> Set["Node"]:
    if roots is None:
        roots = set()
    non_roots = set()
    for child, _, parent in graph.subject_objects(prop):
        non_roots.add(child)
    for parent, _, child in graph.subject_objects(prop):
        non_roots.add(child)

    for s, _, _ in graph.subject_objects(prop):
